INSERT INTO room(number_of_places, price_per_night, description)
VALUES(3,50.50, 'Compact bedrooms are suited for single occupancy or short-stay double occupancy as they have limited space and storage.');

INSERT INTO room(number_of_places, price_per_night, description)
VALUES(5,78.70, 'A warm Tuscan style two-story room with a king size bed and outdoor balcony on the lower level, and a queen size bed in the upper floor loft. This room also contains a shower/tub combination with a granite vanity in the restroom.');

INSERT INTO room(number_of_places, price_per_night, description)
VALUES(2,100.50, 'This exquisite suite is modish in design with vibrant art and d√©cor. Located in the entry is a bar station with a refrigerator.  The bedroom has a king size bed and flat screen television with a desk work area. The luxurious bathroom boasts a spacious walk-in shower with double shower heads, and roomy vanity counters.');

INSERT INTO room(number_of_places, price_per_night, description)
VALUES(3,100.00, 'A charming suite preserving the heritage in the historic inn building that offers a distinct charm with a private patio, king canopy bed, soaking tub, separate tiled shower, tucked away dining room with a mirror dressing table, and a refrigerator. The Hideaway Suite requires entry through the Towne House Restaurant, as it is located on the second floor of the original historic inn.');

INSERT INTO room(number_of_places, price_per_night, description)
VALUES(4,120.00, 'This room include two queen size beds, flat screen tv, tiled shower-bath tub combination, a refrigerator, and coffee station. This room also have work desk areas and French doors leading out to either a balcony or veranda.');

